import React, { useState } from "react";
import { Navbar, Nav, Container } from "react-bootstrap";

const Navigation = () => {
  const [expanded, setExpanded] = useState(false);

  const handleToggle = () => {
    setExpanded(!expanded);
  };

  return (
    <Navbar bg="light" expand="lg" expanded={expanded} className="navigation">
      <Container>
        <Navbar.Brand href="#">Logo</Navbar.Brand>
        <Navbar.Toggle
          aria-controls="basic-navbar-nav"
          onClick={handleToggle}
        />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#">Menu 1</Nav.Link>
            <Nav.Link href="#">Menu 2</Nav.Link>
            <Nav.Link href="#">Menu 3</Nav.Link>
            <Nav.Link href="#">Menu 4</Nav.Link>
            <Nav.Link href="#">Menu 5</Nav.Link>
            <Nav.Link href="#">Menu 6</Nav.Link>
            <Nav.Link href="#">Menu 7</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Navigation;
